import React from 'react';

const HomePage = () => {
    return (
        <div className="min-h-screen bg-gradient-to-b from-[#ff5002] to-[#150824] p-4">
            {/* Top bar */}
            <div className="bg-[#150824] flex justify-between items-center p-4 rounded-lg">
                <div className='flex items-center space-x-4 bg-[#a8acb3] bg-opacity-80 hover:bg-opacity-100 border border-[#150824]-300 p-2 rounded-md transition-opacity duration-300'>
                    <img src="https://pdf-background-images.s3.us-east-2.amazonaws.com/logo.png" alt="Logo" className="h-10" />
                    <span className='text-white text-lg font-bold'>Onboarding Tools</span>
                </div>
                <button className="bg-[#a8acb3] bg-opacity-80 text-[#150824] font-bold px-4 py-2 rounded-md hover:bg-opacity-100 transition">
                    Log In
                </button>
            </div>

            {/* Content */}
            <div className="flex justify-center items-center h-full">
                {/* Additional content can go here */}
            </div>
        </div>
    );
}

export default HomePage;
